  graph = {}
  for char in s:
    if char not in graph:
      graph[char] = []
    graph[char].append(char)

  def generate(token, index):
    if index == len(s):
      return True

    if s[index] == 't':
      if index > 0 and s[index - 1] == 't':
        if generate(token, index + 1):
          return True

      return False
    elif s[index] == 'n':
      if index + 1 < len(s) and s[index + 1] == 'o':
        if generate(token, index + 2):
          return True
      else:
        return False
    else:
      return False

  if generate('t', 0):
    print('Yes')
  else:
    print('No')

solve()
